import { useSelector } from 'react-redux'
import './GameList.css'
const GameList = () =>{
    const games = useSelector((state) => state.games)
    return (
        <div className="app-block game-list">
        <h2>Game List </h2>
            {games.length === 0 ? (
                <p>no games played</p>
            ) : (
                <ul> 
                games.map((game, i) => (
                    <li key={i}> 
                        <div className='game-info'> {games.title}, {game.studio} </div>
                    </li>
                )
                </ul>
            )}


        </div>
    )
}
export default GameList
